import React from "react";
// var React = require("react");
import ReactDOM from 'react-dom';
// var ReactDOM = require("react-dom");
// ReactDOM.render('kya dikhana hai', 'kahan dikhana hai', 'callback func')

// 1st Way of rendering 
// With the help of React we can use rendor method and with te help of ReactDOM we can use JSX
// ReactDOM.render(
//   <h1>Hello World</h1> , document.getElementById("root")
// );

// 2nd Way of rendering 
// The code that Babel JS compile on the backend to make it understandable 
// import { jsx as _jsx } from "react/jsx-runtime";
// ReactDOM.render( jsx("h1", {
//   children: "Hello World"
// }), document.getElementById("root"));

// 3rd Way of rendering 
// Manually using only Javascript to create and render h1 element
// var h1 = document.createElement('h1');
// h1.innerHTML='Muneeba Manzoor';
// document.getElementById('root').appendChild(h1)

// ----------- Rendering Multiple Elements within a render() --------------
ReactDOM.render( 
  <div>
  <h1>Rendering two elements Together</h1>
  <p>Use a div tag to wrap all the element tags into te main div tag</p>
  </div> , document.getElementById('root'))

//In v16.X.X of react, its possible for render to return an array of elements/
ReactDOM.render( [
  <h1>Rendering two elements Together with the help of Array</h1>,
  <p>Use a Square Bracket to wrap all the element tags into te main div tag separated by commas</p>,
  ], document.getElementById('root'))
